[Form]
public class WHSLocationDirectiveAcceptanceTest extends FormRun
{
    private InventDimCtrl_Frm  inventDimFormSetupAdjustInvent;
    private InventDimCtrl_Frm  inventDimFormSetupWhen;

}

public void updateDesignAdjustInvent(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupAdjustInvent)
            {
                inventDimFormSetupAdjustInvent = WHSLocationDirectiveAcceptanceTestInventDimCtrl::newFromForm(element, WHSLocationDirectiveAcceptanceTestInventAdjustmentInventDim_DS.name());
                inventDimFormSetupAdjustInvent.parmSkipOnHandLookUp(true);
                InventDimParm defaultDimensions;
                defaultDimensions.InventSiteIdFlag = NoYes::Yes;
                defaultDimensions.InventLocationIdFlag = NoYes::Yes;
                defaultDimensions.WMSLocationIdFlag = NoYes::Yes;
                defaultDimensions.InventStatusFlag = NoYes::Yes;
                inventDimFormSetupAdjustInvent.parmDimParmVisibleGrid(defaultDimensions);
            }
        // fall-through

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupAdjustInvent.formActiveSetup(InventDimGroupSetup::newItemId(WHSLocationDirectiveAcceptanceTestInventAdjustment.ItemId));
            inventDimFormSetupAdjustInvent.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange:
            inventDimFormSetupAdjustInvent.formActiveSetup(InventDimGroupSetup::newItemId(WHSLocationDirectiveAcceptanceTestInventAdjustment.ItemId));
            inventDimFormSetupAdjustInvent.formSetControls(false);
            break;

        default: 
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public void updateDesignWhen(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupWhen)
            {
                inventDimFormSetupWhen = WHSLocationDirectiveAcceptanceTestInventDimCtrl::newFromForm(element, WHSLocationDirectiveAcceptanceTestInventDim_DS.name());
                inventDimFormSetupWhen.parmSkipOnHandLookUp(true);
            }
            // fall-through

        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupWhen.formActiveSetup(InventDimGroupSetup::newItemId(WHSLocationDirectiveAcceptanceTest.ItemId));
            inventDimFormSetupWhen.formSetControls(true);
            this.enableOrderNum();
            break;

        case InventDimFormDesignUpdate::FieldChange:
            inventDimFormSetupWhen.formActiveSetup(InventDimGroupSetup::newItemId(WHSLocationDirectiveAcceptanceTest.ItemId));
            inventDimFormSetupWhen.formSetControls(false);
            this.enableOrderNum();
            break;

        default: 
            throw error(strFmt("@SYS54195", funcName()));
    }
}

public void init()
{
    // Clear link with caller to avoid title breadcrumb
    element.args().record(null);

    super();

    element.enableDependentControls(false);
    element.updateDesignWhen(InventDimFormDesignUpdate::Init);
    element.updateDesignAdjustInvent(InventDimFormDesignUpdate::Init);
}

public int active()
{
    int ret = super();

    element.updateDesignWhen(InventDimFormDesignUpdate::Active);
    element.enableDependentControls(WHSLocationDirectiveAcceptanceTest.RecId != 0);

    return ret;
}

public void modified()
{
    super();

    element.updateDesignWhen(InventDimFormDesignUpdate::FieldChange);
    ItemId itemId = WHSLocationDirectiveAcceptanceTest.ItemId;

    WHSLocationDirectiveAcceptanceTestInventDim.clearNotActiveDim(InventDimGroupSetup::newItemId(itemId));

    if (itemId)
    {
        InventTable inventTable = InventTable::find(itemId);
        if (InventDimGroupSetup::newDimensionGroups(0, inventTable.storageDimensionGroup(), 0).isDimensionActive(fieldNum(InventDim, InventStatusId)))
        {
            WHSLocationDirectiveAcceptanceTestInventDim.InventStatusId = WHSInvent::getDefaultStatus(WHSLocationDirectiveAcceptanceTestInventDim);
        }
    }
}

public void write()
{
    // Do not call super() - saving occurs when setting the InventDimId on write of the joined table
}

public int active()
{
    int ret = super(); 

    element.updateDesignAdjustInvent(InventDimFormDesignUpdate::Active);

    return ret;
}

public void write()
{
    // Do not call super() - saving occurs when setting the InventDimId on write of the joined table
}

public void initValue()
{
    ItemId itemId = WHSLocationDirectiveAcceptanceTestInventAdjustment.ItemId ? 
                        WHSLocationDirectiveAcceptanceTestInventAdjustment.ItemId :
                        WHSLocationDirectiveAcceptanceTest.ItemId;

    if (itemId)
    {
        InventTable inventTable = InventTable::find(itemId);

        WHSLocationDirectiveAcceptanceTestInventAdjustmentInventDim.InventSiteId = WHSLocationDirectiveAcceptanceTestInventDim.InventSiteId;
        WHSLocationDirectiveAcceptanceTestInventAdjustmentInventDim.InventLocationId = WHSLocationDirectiveAcceptanceTestInventDim.InventLocationId;

        if (InventDimGroupSetup::newDimensionGroups(0, inventTable.storageDimensionGroup(), 0).isDimensionActive(fieldNum(InventDim, InventStatusId)))
        {
            WHSLocationDirectiveAcceptanceTestInventAdjustmentInventDim.InventStatusId = WHSInvent::getDefaultStatus(WHSLocationDirectiveAcceptanceTestInventAdjustmentInventDim);
        }
    }

    super();
}

public void clicked()
{
    super();

    Dialog dlg = new Dialog(strFmt("@WAX:LocationDirectiveAcceptanceTestDuplicate", WHSLocationDirectiveAcceptanceTest.Name));
    dlg.formBuildDesign().dialogSize(DialogSize::Small);

    DialogField dlgField = dlg.addField(extendedTypeStr(WHSLocationDirectiveAcceptanceTestName), "@WAX:LocationDirectiveAcceptanceTestNewName");
    dlgField.value(WHSLocationDirectiveAcceptanceTest.Name);

    if (dlg.run())
    {
        WHSLocationDirectiveAcceptanceTestName newName = dlgField.value();

        if (newName &&
            whsLocationDirectiveAcceptanceTest.duplicate(newName))
        {
            whsLocationDirectiveAcceptanceTest_ds.research(true);
        }
    }
}
